    "description": "This Chinese-style pork belly is sweet, salty, and perfectly tender. Slowly cooking the pork in a flavorful mixture of garlic, ginger, and brown sugar gives it that signature sticky-sweet glaze that pairs perfectly with salty soy sauce. Serve it over rice for the ultimate dinner and forget you ever wanted to order take-out.",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/024f4cde9e574cc68953f98243e3d30f/BFV17463_ChineseStyleGlazedPorkBelly-ThumbA1080.jpg",
    "name": "Chinese-style Glazed Pork Belly Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "500 grams pork belly, preferably lean"
          ,"1 liter water"
          ,"n/a"
          ,"1 spring onion, cut into 2-inch pieces"
          ,"2 cloves garlic, crushed"
          ,"15 milliliters oil"
          ,"25 grams brown sugar"
          ,"45 milliliters light soy sauce"
          ,"45 milliliters dark soy sauce"
          ,"30 milliliters rice wine, shaoxing"
          ,"Cooked rice, to serve"
          ,"Sliced green onions, to serve"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Cut the pork belly into roughly 1-inch (2 ½ cm) cubes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bring 1 liter of water to a boil in a pot, then add the pork, ginger, onion, and garlic, and cook for 3-4 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the pork from the water using a slotted spoon and drain on a plate lined with a paper towel. Discard the remaining water and vegetables."
        }
        ,{
          "@type": "HowToStep",
          "text": "Clean and dry the pot, then return it to high heat and add the olive oil. Return the pork to the pan and cook until browned. The oil may pop and splatter, so be careful."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the brown sugar, then reduce the heat to low. Stir continuously until the sugar has melted, caramelized, and coated the pork evenly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Immediately add the soy sauces and rice wine, stirring continuously for 5-6 minutes more, or until the liquid has reduced to a thick glaze."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the remaining 250 milliliters of water. Stir, cover, and simmer for about 45 minutes. Make sure the mixture is at a low simmer, not boiling. Stir every 10 minutes or so, adding more water if the pot is getting dry."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the lid. The sauce should coat the pork in a very thick glaze. If it is too runny, continue to stir, uncovered, until the liquid has reduced."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve immediately over a bowl of rice and sprinkle with sliced green onions."
        }
        ,{
          "@type": "HowToStep",
          "text": "Nutrition  Calories: 1704 Fat: 162 grams  Carbs: 27 grams Fiber: 1 gram  Sugars: 9 grams  Protein: 30 grams"
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
