    "description": "Here's what you need: chicken breast, salt, pepper, corn flour, oil, onion, bell pepper, soy sauce, red wine vinegar, tomato paste, sugar, chicken stock, pineapple, water, cornflour, egg yolk, milk",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/a6c728f2acd5449f86640dbf5c7c6c81/Chinese_Chicken_FB_Thumbnail.jpg",
    "name": "Sticky Chinese BBQ Chicken Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "3 chicken breasts"
          ,"Salt, to season"
          ,"Pepper, to season"
          ,"100 grams cornflour"
          ,"1.5 litres oil, for frying"
          ,"1 onion"
          ,"2 bell peppers"
          ,"2 tablespoons soy sauce"
          ,"2 tablespoons red wine vinegar"
          ,"2 tablespoons tomato paste"
          ,"2 tablespoons sugar"
          ,"100 milliliters chicken stock"
          ,"200 grams pineapple"
          ,"n/a"
          ,"50 milliliters cornflour paste"
          ,"Egg wash (2 egg yolks and milk)"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Season the chicken with salt and pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut into bite-size chunks."
        }
        ,{
          "@type": "HowToStep",
          "text": "Dunk each chicken piece in the egg yolk, followed by the cornflour. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat the oil in a deep saucepan until it reaches 190°C (375°F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Carefully fry the chicken pieces for around 5-6 minutes, until crispy, slightly golden in colour and cooked throughout."
        }
        ,{
          "@type": "HowToStep",
          "text": "Drain onto a plate covered in kitchen roll."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large saucepan over a medium heat, add 1 tablespoon of oil and fry the onions and peppers for 2-3 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in the soy sauce, red wine vinegar, tomato paste, sugar, and chicken stock. Cook for a further 2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add in cornflour paste."
        }
        ,{
          "@type": "HowToStep",
          "text": "Mix until the sauce has thickened."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in the pineapple and chicken until evenly coated with the sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with rice."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
