    "description": "This is a traditional and popular Chinese classic dessert, served during Lunar New Year and it that will satisfy your sweet cravings.",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/201101.jpg",
    "name": "Chinese Fried Sesame Balls Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "¼ cup dried red beans"
          ,"4 cups water, divided"
          ,"¼ cup sugar"
          ,"⅔ cup hot water"
          ,"½ cup light brown sugar"
          ,"2 cups glutinous rice flour, plus more for dusting"
          ,"½ cup sesame seeds"
          ,"7 cups vegetable oil"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Make the red bean filling: In a medium bowl, combine the red beans with 1 cup (240 ml) of water. Cover with plastic wrap and soak overnight."
        }
        ,{
          "@type": "HowToStep",
          "text": "Drain the red beans, then transfer to a small saucepan with the remaining 3 cups (720 ml) of water. Bring to a boil over medium-high heat, then cover and cook for 1 hour, until soft enough to mash with a fork."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the sugar and cook, stirring frequently, until the liquid evaporates and a thick red bean paste forms."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the red bean paste to a bowl. Cover with plastic wrap, pressing it directly onto the surface of the paste to prevent a skin from forming. Refrigerate until ready to use."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make the dough: In a liquid measuring cup or small bowl, whisk the hot water with the light brown sugar until the sugar dissolves."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the glutinous rice flour to a medium bowl and use a spoon to create a small well in the center."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the sugar syrup into the well and stir for 5 minutes, until the dough is well combined and no longer sticks to the bowl."
        }
        ,{
          "@type": "HowToStep",
          "text": "Lightly dust a clean surface with glutinous rice flour. Turn the dough out and knead for 5 minutes, until it forms a smooth, round ball. Use a little bit more flour or water as needed."
        }
        ,{
          "@type": "HowToStep",
          "text": "Divide the dough into 8 pieces. Roll the pieces into small balls, then flatten into discs about ½-inch (1 ¼ cm) thick and 2½-inches (6.5 cm) in diameter."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place 1 teaspoon of red bean filling in the center of a piece of dough. Fold in the edges to cover the filling, then roll into a ball. Roll the ball in the sesame seeds until the dough is covered. Repeat with the remaining ingredients."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat the vegetable oil in a large pot until it reaches 350°F (180°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Fry the sesame balls for 15 minutes, stirring frequently, until golden brown. Transfer to a wire rack set over a baking sheet to drain and let cool for 15 minutes before serving."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
