          "1 egg"
          ,"1 tsp of white pepper"
          ,"1 1/2 tsp of salt"
          ,"2 chicken breasts, cubed"
          ,"1/2 cup of corn starch"
          ,"1/4 cup of flour"
          ,"vegetable oil for frying"
