    "image": "https://img.buzzfeed.com/video-api-prod/assets/c0a669316b934eb68858adde9a6b2d19/BFV21932_Tofu_Beef_And_Broccoli_THUMB.jpg",
    "name": "Chinese Takeout-style Tofu And Broccoli Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "14 ounces firm tofu"
          ,"1 teaspoon vegetable oil"
          ,"1½ teaspoons sesame oil, divided"
          ,"3 cups broccoli florets"
          ,"3 tablespoons vegetable broth"
          ,"2 cloves garlic, minced"
          ,"1 teaspoon grated ginger"
          ,"¼ cup soy sauce"
          ,"2 tablespoons agave syrup"
          ,"1 tablespoon rice vinegar"
          ,"1-2 tablespoons cornstarch slurry (1 tablespoon cornstarch mixed with 1 tablespoon water)"
          ,"1½ teaspoons toasted sesame seeds"
          ,"n/a"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Wrap the tofu in 2 layers of paper towels and place on a plate. Put another plate on top of the tofu to weigh it down and microwave for 2-3 minutes, or until drained."
        }
        ,{
          "@type": "HowToStep",
          "text": "After microwaving, carefully unwrap the tofu and slice into ½-1 inch cubes. Pat each cube dry."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large nonstick skillet, heat the vegetable oil and 1 teaspoon of sesame oil over medium-high heat. Once the oil is hot, add the tofu and cook on all sides until golden brown, 2-4 minutes per side, then remove from the pan and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add broccoli to the hot pan with the vegetable broth. Cover and reduce the heat to medium-low. Steam for 5 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the lid and increase the heat to medium-high."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the garlic, ginger, and remaining ½ teaspoon of sesame oil. Stir until softened."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the soy sauce, agave, rice vinegar, and cornstarch slurry. Stir until thickened to your desired consistency. Add the sesame seeds and stir to incorporate."
        }
        ,{
          "@type": "HowToStep",
          "text": "Return the tofu to the pan and toss to coat in the sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve over white rice and garnish with scallions and sesame seeds."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
