    "description": "Here's what you need: large egg white, small sweet potato, extra virgin olive oil, small yellow onion, kosher salt, ground pepper, kale leaves, blood orange, water",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/41efb4f6bf1841bf8983b7df73705c2a/BFV5092_KaleSweetPotatoandOnionFrittata-Thumb1080.jpg",
    "name": "Kale, Sweet Potato, and Onion Frittata Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 large egg whites*"
          ,"1 small (3 to 4 inches long) sweet potato, cut in ½-inch cubes"
          ,"2 teaspoons extra-virgin olive oil"
          ,"1 small yellow onion, roughly chopped"
          ,"Kosher salt and freshly ground pepper, to taste"
          ,"n/a"
          ,"2 cups chopped kale leaves (about half of 1 bunch), ribs and stems removed"
          ,"½ blood orange (or ½ a small navel orange)"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat the oven to 450°F (230°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Whisk together the 3 egg yolks in a small mixing bowl and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "NOTE: You’ll have 4 yolks leftover. You can either discard them, or freeze them for later use."
        }
        ,{
          "@type": "HowToStep",
          "text": "Beat the seven egg whites (or nine egg whites) in a large mixing bowl with a large whisk until they form soft peaks."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the yolks to the beaten whites and very gently whisk the mixture, just to combine. Set the eggs aside in the fridge while you cook the vegetables."
        }
        ,{
          "@type": "HowToStep",
          "text": "Combine the cubed sweet potato with 1 cup water (235 ml) in a large, nonstick, oven-safe skillet over high heat. Bring to a boil, then reduce the heat to a simmer and cook, stirring occasionally, just until all the water has evaporated and the sweet potato is soft on the outside, about 8 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "NOTE: If you don’t have a large nonstick skillet, you can use a regular, oven-safe skillet. Just be sure to coat it thoroughly with oil."
        }
        ,{
          "@type": "HowToStep",
          "text": "As soon as the water is evaporated, add the olive oil and onion, stir together, and season with salt and pepper. Cook over medium heat, stirring often, until the onion starts to soften, about a minute."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the chopped kale and cook, stirring often, until the kale is wilted and dark green, about 2 minutes more."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread the vegetables evenly over the bottom of the skillet, then pour the egg mixture on top and spread it in an even layer."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake in the preheated oven until the frittata is puffed, cooked through, and very lightly browned on top, 5 to 6 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Let the frittata cool in the skillet for 5 minutes, then flip it onto a cutting board and cut it in half."
        }
        ,{
          "@type": "HowToStep",
          "text": "Eat half for breakfast, with ½ a blood orange, cut into wedges."
        }
        ,{
          "@type": "HowToStep",
          "text": "For the leftovers, let the remaining half cool completely before storing in an airtight container in the fridge."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
