    "description": "Here's what you need: warm water, sugar, olive oil, instant yeast, all-purpose flour, salt, large egg, ricotta cheese, fresh parsley, grated pecorino romano, ham, pepperoni, provolone cheese, salami, prosciutto, bread crumbs, large egg",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/146739.jpg",
    "name": "Easter Savory Pie (Pizza Rustica) Recipe by Tasty",
