    "recipeIngredient": [
          "2 medium white potatoes"
          ,"1/4 white onion"
          ,"1 Tbsp Italian seasoning (a blend of basil, oregano, rosemary, thyme, and black pepper)"
          ,"1 tsp lemon juice"
          ,"2-4 cloves of garlic"
          ,"1 tsp salt"
          ,"12 oz fettuccine pasta"
          ,"n/a"
          ,"n/a"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Boil 4 cups (945 ml) of water in a small pot."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut a quarter of an onion into cubes. Peel and chop the potatoes into ½ inch (1 cm) cubes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add onion and potatoes to pot and boil for 10 minutes, or until soft."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove potatoes and onion from the pot. Make sure to save the water."
        }
        ,{
          "@type": "HowToStep",
          "text": "Begin cooking fettuccine pasta in a separate pot."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a blender, combine 1 cup (235ml) of the water used to boil the veggies, raw cashews, veggies, lemon juice, and seasonings. Blend until creamy. Add more of the boiling water if the mixture is too thick."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add salt to taste and garlic."
        }
        ,{
          "@type": "HowToStep",
          "text": "NOTE: Adding 1 tsp of nutritional yeast, and ¼ tsp truffle oil will really make this dish pop with cheesy flavor!"
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the sauce over the cooked pasta and serve."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
