    "image": "https://img.buzzfeed.com/video-api-prod/assets/40c840a942924986810893438c815b3b/YT_thumb_breakfast_onion_cups2.jpg",
    "name": "Breakfast Onion Cups Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 cups broccoli florets, minced"
          ,"1 cup cheddar cheese, shredded"
          ,"7 eggs"
          ,"5 strips bacon, cooked and diced"
          ,"1 large red onion"
          ,"1 teaspoon salt"
          ,"½ teaspoon pepper"
          ,"½ teaspoon chili powder"
          ,"2 tablespoon milk"
          ,"Parmesan cheese"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Heat oven to 400˚ (200˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Mix eggs, milk, and spices in large mixing bowl."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add broccoli, bacon, and cheese, and continue mixing until all ingredients are well incorporated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut ends off the red onion and then slice in half. Gently pop out rings, using desired size."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat cast-iron pan on low and place onion rings in the pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spoon in small amount of egg mixture and press on the onion ring create a seal, then repeat for all rings."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the remaining mixture filling to just about the top of each ring."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover with foil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place in oven and cook for 25 minutes, or until eggs are cooked through and slightly puffed and onion rings are tender."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove from pan immediately and sprinkle with desired topping. (We used grated parmesan cheese.)"
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
