    "recipeIngredient": [
          "3½ cups unbleached all-purpose flour, plus more for kneading and dusting"
          ,"1 teaspoon salt"
          ,"5 tablespoons extra-virgin olive oil"
          ,"1¼ cups water, room temperature"
          ,"1 tablespoon canola oil"
          ,"2 large yellow onions, sliced"
          ,"4 large bell peppers, seeded and sliced"
          ,"1 teaspoon salt"
          ,"1 teaspoon dried oregano"
          ,"1 tablespoon canola oil"
          ,"6 Yukon Gold potatoes, skin-on, boiled and diced"
          ,"1 teaspoon salt"
          ,"¼ teaspoon pepper"
          ,"1 teaspoon smoked paprika"
          ,"10 strips of bacon, cooked and crumbled"
          ,"1 cup shredded sharp cheddar cheese"
          ,"2 cups sautéed spinach"
          ,"10 small breakfast sausages, cooked"
          ,"12 eggs, scrambled"
          ,"10 Italian sausages, cooked"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Make the flour tortilla: In a large bowl, combine the flour and salt. Add the olive oil and mix well. The texture should look like coarse cornmeal."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the water and knead until the dough comes together in a ball. If it is too wet, add more flour. Wrap the dough with plastic wrap or cover with a damp cloth.  Let rest for 10 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make the sautéed vegetables: In a large skillet, heat the canola oil over medium heat. Add the onions and bell peppers. Season with the salt and oregano. Cook until the vegetables are soft, about 10 minutes. Remove from the pan and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make the home fries: In a large skillet, heat the canola oil over medium heat. Add the potatoes. Season with the salt, pepper, and paprika. Cook until the outsides of the potatoes are slightly crispy, about 5 minutes. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 425°F (220°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Grease 10-inch (25 cm) diameter Dutch oven well with olive oil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the dough from the fridge and transfer to a lightly floured surface. Using a rolling pin, roll out the dough to about ⅛ inch (3 mm) thick and 2 times larger than the Dutch oven."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the rolled out dough to the pot, pressing down around the edges so it forms to the inside of the pot and letting the excess hang over the sides."
        }
        ,{
          "@type": "HowToStep",
          "text": "Layer the home fries, bacon, cheese, spinach, breakfast sausages, sautéed vegetables, scrambled eggs and cooked Italian sausages over the dough. Fold the overhanging dough over the top."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 40 minutes, or until the top is golden brown. Let cool for 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Invert the timpano onto a cutting board and let cool for 10 more minutes before slicing."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
