    "recipeIngredient": [
          "2 cups warm water"
          ,"1 tablespoon sugar"
          ,"½ cup olive oil"
          ,"1 tablespoon instant yeast"
          ,"5½ cups all-purpose flour"
          ,"1 tablespoon salt"
          ,"10 large eggs"
          ,"16 ounces ricotta cheese"
          ,"1 cup chopped fresh parsley"
          ,"4 ounces Pecorino Romano cheese, grated"
          ,"8 ounces boiled ham, cubed"
          ,"8 ounces pepperoni, cubed"
          ,"8 ounces provolone cheese, cubed"
          ,"8 ounces hard salami, cubed"
          ,"4 ounces prosciutto, chopped"
          ,"1½ cups bread crumbs"
          ,"1 large egg, beaten"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a large mixing bowl, combine the warm water, sugar, olive oil, and instant yeast."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the flour and salt, and mix the dough together with a wooden spoon until it forms a ball. Then knead the dough for 1 minute, or until it feels smooth and springy."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover the dough in the bowl with a kitchen towel or plastic wrap. Let rise in a warm place for 2 hours."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 350°F (180°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large bowl, add 10 eggs, ricotta, parsley, and Pecorino Romano. Whisk the mixture until smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the ham, pepperoni, provolone, hard salami, prosciutto, and bread crumbs. Fold in the cubed meats and cheeses. The texture should be thick and slightly wet."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once the dough has doubled in size, dump it onto a floured surface, knead for 2 minutes, and shape it into a ball. Roll the dough out to a rough circle, about ¼-inch (½-cm) thick."
        }
        ,{
          "@type": "HowToStep",
          "text": "With a pizza cutter or knife, cut out a large disc that is 2 inches (5-cm) wider than a 9-inch (23-cm) springform pan or round baking dish. With the rest of the dough, cut thick strips about 9 inches (23-cm) long and 1 inch (2 cm) thick."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the dough disc into the springform pan or baking dish. Gently press the dough against the bottom and sides of the pan, allowing the excess to hang over the sides."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the egg, cheese, and meat mixture into the pan. Pack the filling down and smooth the top with a spatula."
        }
        ,{
          "@type": "HowToStep",
          "text": "Weave the strips of dough on top to create a decorative pattern. Trim any excess dough, then fold and crimp the edges. Brush the top with egg wash."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake the pizza rustica for 2 hours, or until the filling is cooked through and the pizza dough has browned."
        }
        ,{
          "@type": "HowToStep",
          "text": "Let the the pizza rustica cool completely. Remove from the pan. Chill in the refrigerator overnight on a wire rack."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
