    "recipeIngredient": [
          "1¼ cups warm water (95˚F)"
          ,"1 ¼-ounce packet active dry yeast"
          ,"1½ teaspoons sugar"
          ,"3½ cups “00” flour (or all-purpose if you can’t find “00”), plus more for dusting"
          ,"2 tablespoons salt"
          ,"¼ cup extra virgin olive oil"
          ,"2 cups strained tomatoes"
          ,"Fresh basil leaves"
          ,"Fresh mozzarella"
          ,"Olive oil"
          ,"Salt"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a small mixing bowl, whisk the warm water, yeast, and sugar together. Place in a warm place for 10 minutes, or until yeast is foamy."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large mixing bowl, whisk together the flour and salt."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make a well in the center of the dry ingredients and add the yeast mixture and olive oil. Stir the wet ingredients into the dry ingredients until the dough comes together and becomes difficult to stir."
        }
        ,{
          "@type": "HowToStep",
          "text": "Turn the dough out onto a lightly floured surface and knead until the dough is smooth, about 5 minutes. Add small amounts of flour as necessary to prevent sticking."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the dough to a large bowl coated with olive oil. Cover with a towel and let rise in a warm place for 1-2 hours, until the dough has doubled in size."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once the dough has doubled in size, remove the towel and punch the dough down. Turn out onto a lightly floured surface and divide the dough into 6-8 pieces, and shape each into a small ball."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place the formed balls onto a baking sheet and rest, covered, for 15 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "To shape the individual pizzas, press out the dough balls onto a lightly floured surface. Create a slightly thicker rim around the outside of the dough and continue to stretch into a 9- to 10-inch (23-25 cm) round."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat a large cast-iron pan over medium heat, until the pan just begins to smoke, about 5 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Carefully transfer a stretched pizza round onto the hot pan. Leave to cook for 2-3 minutes (the dough should begin bubbling up) until lightly tanned with a few dark spots. Flip and continue to cook on the other side for 1-2 minutes longer, until the crust is completely dry."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the dough to rest on a wire rack and repeat with remaining dough."
        }
        ,{
          "@type": "HowToStep",
          "text": "To finish the pizzas, top each crust with tomato sauce and fresh mozzarella."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer to the oven and broil for 7 or 8 minutes, until the cheese has melted and the crust has developed a nice char in spots. Watch closely and move to a lower rack if necessary."
        }
        ,{
          "@type": "HowToStep",
          "text": "Finish each pizza with fresh basil, a drizzle of olive oil, and a sprinkle of salt."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
