    "description": "Here's what you need: kalamata olive, roasted red pepper, caper, black pepper, italian seasoning, celery seed, red pepper flakes, italian giardiniera, extra virgin olive oil, mini French boules, salami, mortadella, sopressata, provolone cheese",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/216783.jpg",
    "name": "Mini Muffulettas Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "1 cup pitted Kalamata olives, drained"
          ,"½ cup roasted red peppers, roughly chopped"
          ,"2 tablespoons capers, drained"
          ,"¼ teaspoon black pepper"
          ,"½ teaspoon Italian seasoning"
          ,"¼ teaspoon celery seeds"
          ,"¼ teaspoon red pepper flakes"
          ,"1 16-ounce jar of Italian giardiniera, drained"
          ,"⅓ cup extra-virgin olive oil"
          ,"2 mini French boules"
          ,"8 slices salami"
          ,"8 slices mortadella"
          ,"8 slices sopressata"
          ,"4 slices provolone cheese"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Make the olive salad: Add the olives, red peppers, capers, pepper, Italian seasoning, celery seeds, red pepper flakes, and giardiniera to a food processor and pulse until coarsely chopped. Transfer to a medium bowl and whisk in the olive oil. Cover and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make the muffalettas: Cut off the top ⅓ of each boule and set aside. Carefully remove the inside of the loaf, leaving about a ½-inch-thick (1 ¼ cm) layer of bread behind. Reserve the bread scraps for another use."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add a large spoonful of olive salad to the bottom of the bread bowls and spread evenly. Layer 4 slices of salami, 4 slices of mortadella, 4 slices of sopressata, and 2 slices of provolone in each loaf. Top with another layer of olive salad and spread evenly. Cover with the bread tops. Cover tightly with plastic wrap and refrigerate for at least 4 hours, up to overnight."
        }
        ,{
          "@type": "HowToStep",
          "text": "When ready to serve, slice the muffalettas into quarters."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
