    "description": "Here's what you need: water, full bodied red wine, spaghetti, olive oil, garlic, red pepper flakes, butter, freshly grated parmesan cheese, flatleaf italian parsley",
    "image": "https://s3.amazonaws.com/video-api-prod/assets/d7508bc136404faab19ed7333d56f81c/BFV8733_RedWineSpaghetti_Thumb.jpg",
    "name": "Red Wine Spaghetti Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 cups water"
          ,"1 bottle full bodied red wine (we used cabernet)"
          ,"1 pound spaghetti"
          ,"2 tablespoons olive oil"
          ,"4 cloves garlic, thinly sliced"
          ,"1 teaspoon red pepper flakes"
          ,"2 tablespoons butter"
          ,"1 cup freshly grated parmesan"
          ,"1/2 cup flatleaf Italian parsley"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Measure ¼ cup (60 ml) of wine and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Combine the water and the remainder of the bottle of wine in a large pot and bring to a boil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once boiling, add spaghetti and cook (stirring frequently) until al dente, about 7 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Reserve ¼ cup (60 ml) of the cooking liquid and drain the spaghetti. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large skillet, heat the olive oil on medium heat. Add the garlic and red pepper flakes and cook for 2 minutes, stirring occasionally."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the reserved cooking liquid and reserved wine to the skillet and bring to a simmer. Add the pasta and toss to coat with the sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the butter and stir until it melts into the pasta."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add salt and pepper, parmesan, and parsley. Stir to combine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve on its own or top with more parmesan and parsley and open up another bottle of wine!"
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
