    "description": "Here's what you need: flour, egg, salt",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/15629d022b244f9fbbb45d821d8f9278/Homemapasta.jpg",
    "name": "Homemade Vs. Store-bought: Pasta Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "1 ½ cups flour"
          ,"3 eggs, beaten"
          ,"¼ cup salt"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Create a small mountain of flour and, using a spoon, begin building a hole in the middle. It should end up looking like a small volcano."
        }
        ,{
          "@type": "HowToStep",
          "text": "Gradually add eggs in the volcano’s hole, and carefully incorporate eggs and flour."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once all ingredients have been mixed, knead the dough by pulling, stretching, and folding for about 3-5 minutes, or until it turns elastic and semi-easy to mold."
        }
        ,{
          "@type": "HowToStep",
          "text": "Mold the dough into a sphere, and wrap it in plastic wrap and rest for 30 minutes, or until the dough becomes more relaxed, elastic, and much easier to mold."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut the dough in four pieces. Grab the first one, and keep the other wrapped, or cover them with a slightly wet towel to keep them fresh."
        }
        ,{
          "@type": "HowToStep",
          "text": "Flatten the first piece, and run it through the widest setting of your pasta maker. Increase the thinness number by one level each time you run the pasta through the machine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once you can see your fingers through the dough, proceed to cut the fettuccine, or any shape you wish."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a pot with boiling water and salt, cook the pasta for 2 minutes or until it feels tender to the bite."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with your favorite pasta sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
